import React, {Component} from 'react';
import Button from '../Button/Button';
import "./Popup.scss";

class Popup extends Component {

  render() {
    const {isOn, onToggle} = this.props;
    return(
      <React.Fragment>
      {
        !isOn ? null :       
          <div className="popup">
            <div className="popup__bg"></div>
            <div className="popup__body">
              <button onClick={onToggle}></button>
              <img className="popup__img" src="https://images.unsplash.com/photo-1506994011460-5482746d30a1?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=634&q=80" alt=""/>
              <div className="popup__content">
                <p className="popup__type">Web App</p>
                <h3 className="popup__title">A music store</h3>
                <p className="popup__text">A music store descrption</p>
              </div>
              <Button btnStyle="border" onClick={onToggle}>View Project</Button>
            </div>
          </div>  
      }
      </React.Fragment>
    )
  }
}

export default Popup
